import React, { Component } from 'react';

class Header extends Component
{
    render() {
        return (
            <div>
                <nav class="navbar navbar-light bg-light">
                    <a class="navbar-brand" href="#">Navbar</a>
                </nav>
            </div>
        )
    }
}

export default Header;
